int CModelSizes::GetColCount(void)
{
	return sizeof(MODELS_gColRadius) / sizeof(MODELS_gColRadius[0]);
}

float CModelSizes::GetColSphereRadius(int modelid)
{
	if (0 <= modelid && modelid < CModelSizes::GetColCount())
	{
		return MODELS_gColRadius[modelid];
	}
	return 0.0;
}

CVector CModelSizes::GetColSphereOffset(int modelid)
{
	if (0 <= modelid && modelid < CModelSizes::GetColCount())
	{
		return CVector(MODELS_gColOffset[modelid][0], MODELS_gColOffset[modelid][1], MODELS_gColOffset[modelid][2]);
	}
	return CVector(0.0f, 0.0f, 0.0f);
}